import { Outlet } from "react-router-dom";

export default function Layout() {
  return (
    <div className="app-container">
      <header>Каталог одежды</header>
      <main>
        <Outlet />
      </main>
      <footer>© 2024 Каталог одежды</footer>
    </div>
  );
}
